import styled from "styled-components";

export const SigninContainer = styled.div`
  width: 380px;
  display: flex;
  flex-direction: column;
`;

export const ContainerButton = styled.div`
  display: flex;
  justify-content: space-between;
`;

export const TitleText = styled.h2`
  margin: 10px 0;
`;
